CREATE TABLE `users` (
  `user_id` int NOT NULL AUTO_INCREMENT,
  `username` varchar(45) NOT NULL,
  `pass` varchar(100) NOT NULL,
  `email` varchar(45) NOT NULL,
  `user_type` enum('admin','employee','client') NOT NULL,
  PRIMARY KEY (`user_id`),
